import React, { Component } from "react";

class Aboutme extends Component {
  render() {
    return (
      <div style={{ textAlign: "center", marginLeft: 'auto', color: '#fff', marginRight: 'auto', marginTop: '100px', width: '60%', background: 'gray', padding: '20px'}}>
        <h1 style={{fontSize: '50px', textTransform: 'uppercase', fontFamily: 'Anton, sans-serif'}}>Ismael Miah</h1>
        <p style={{textAlign: 'justify', fontFamily: 'Oxygen, sans-serif'}}>
          This is Angel. Now I am an enthusiastic, proactive, altruistic, open-minded, 
          ready to learn and result- oriented, third-year software Engineering Student
           at Makerere University. I have a great attachment to team-spirit and
            volunteering opportunities as well as shared success. 

        </p>
      </div>
    );
  }
}

export default Aboutme;
